import Admin from "./pages/Admin";
import {ADMIN_ROUTE, LIST_ROUTE, LOGIN_ROUTE, MAIN_ROUTE, REGISTRATION_ROUTE, VACANCY_ROUTE} from "./utils/consts";
import List from "./pages/List";
import Main from "./pages/Main";
import VacancyPage from "./pages/VacancyPage";
import Auth from "./pages/Auth";

export const authRoutes = [
    {
        path: ADMIN_ROUTE,
        Comment: Admin
    },
    {
        path: LIST_ROUTE,
        Comment: List
    }
]

export const publicRoutes = [
    {
        path: MAIN_ROUTE,
        Comment: Main
    },
    {
        path: VACANCY_ROUTE + '/:id',
        Comment: VacancyPage
    },
    {
        path: LOGIN_ROUTE,
        Comment: Auth
    },
    {
        path: REGISTRATION_ROUTE,
        Comment: Auth
    },
]
